'use strict';




```javascript
var randu = require( '@stdlib/random/base/randu' );
var ellipj = require( '@stdlib/math/base/special/ellipj' );

var sncndn;
var u;
var m;
var i;

for ( i = 0; i < 100; i++ ) {
    m = randu();
    u = randu() * 100.0;
    sncndn = ellipj( u, m );
    console.log( 'sn(%d, %d) = %d', u, m, sndncn[ 0 ] );
    console.log( 'cn(%d, %d) = %d', u, m, sndncn[ 1 ] );
    console.log( 'dn(%d, %d) = %d', u, m, sndncn[ 2 ] );
}
```
